import React from "react";
import { Link } from "react-router-dom";

import "../../index.css";
import Me from "../../assets/me.jpeg";
import Logo from "../../assets/ghaneiLogo.png";
import { Navbar } from "react-bootstrap";

const LandingPage = () => {
  return (
    <div className="landingPage">
      <Navbarar bg="light" expand="lg" className="fixed-top shadow flexible-navbar">
      {/* <Navbar.Brand href="#home" className="col-sm-3 col-md-2 mr-0">React-Bootstrap</Navbar.Brand> */}

      <Navbar.Collapse id="basic-navbar-nav">
        <Nav className="mr-auto">
          <NavDropdown title="Menu" id="basic-nav-dropdown" className="ml-4">
            <Link to="/dashboard/about" className="ml-4">About</Link>
            <br/>
            <Link to="/dashboard/skills" className="ml-4">Knowledge</Link>
            <br/>
            <Link to="/dashboard/documents" className="ml-4">Documents</Link>
            <br/>
            <Link to="/dashboard/contact" className="ml-4">Contact</Link>
            <br/>
            <NavDropdown.Divider />
            <Link to="/" className="ml-4">Back</Link>
            <br/>
          </NavDropdown>
        </Nav>
        <Button
          href="#"
          variant="outline-info"
          disabled
          style={{ pointEvents: "none" }}
        >
          <FontAwesomeIcon icon={faCalendarAlt} className="mr-2" />
          {currentDate}
        </Button>
      </Navbar.Collapse>
    </Navbarar>
      <nav className="navbar fixed-top bg-none flex-md-nowrap p-0">
        <Link to="/">
          <img className="logo" src={Logo} alt="Amirreza Ghanei" />
        </Link>
      </nav>
      <section className="container">
        <div className="logo-wrapper waves-effect">
          <img
            className="img-fluid langing-img"
            src={Me}
            alt="hi"
            style={{
              borderTopLeftRadius: "50px",
              borderBottomLeftRadius: "50px"
            }}
          />
        </div>
      </section>
    </div>
  );
};

export default LandingPage;
